import React from "react";

const CharacterCard = (props) => {
  const characterListItems = props.characters.map((character) => {
    return <CharacterCard key={character.id} character={character} />;
  });

  return (
    <section>
      <li></li>
    </section>
  );
};

export default CharacterCard;
